import React, { useState } from 'react';
import Register from './Register';
import Login from './Login';
import Map from './Map';

const App = () => {
  const [token, setToken] = useState(localStorage.getItem('token'));



  return (
    <div>
      {!token ? (
        <>
          <Register />
          <Login setToken={setToken} />
        </>
      ) : (
        <>
          
          <Map />
        </>
      )}
    </div>
  );
};

export default App;
